webpackJsonp([0x99beedf9f741],{506:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Solar Sailer",author:"Matthieu Oger"}},markdownRemark:{html:'<blockquote>\n<p>If [Apple] do not show a first party gaming focused controller [for the new rumored Apple TV], I think that they are not as committed to games as they might think. […]</p>\n<p>And it needs to be a controller with buttons on it.</p>\n<p>— <a href="https://overcast.fm/+CHZ-L5Yhc/1:04:59">Myke Hurley</a></p>\n</blockquote>\n<p>Exactly my thought.</p>\n<p><a href="http://steredenn.pixelnest.io">Steredenn</a> would be cool on the alleged Apple TV… but without a dedicated controller, it\'s a no go.</p>',frontmatter:{date:"2015-09-03",readableDate:"03 September 2015",title:"Quote — Myke Hurley about the new rumored Apple TV — a gaming console?",showPageTitle:null},fields:{path:"/2015/09/quote-myke-hurley-atv-console/"}}},pathContext:{id:"/Users/ashen/Code/solarsailer.net/content/posts/2015-09-03-quote-myke-hurley-atv-console.md absPath of file >>> MarkdownRemark"}}}});
